column8:
見た目にもおしゃれで高級感のあるソフトな革風<br>
スリッパレディースMサイズ。<BR>
手触りが柔らかく、ややマットな光沢が上品です。<BR><BR>

甲部分に【camino】のロゴマークが施してあります。<BR><BR>

スリムデザインですが、若干伸縮性もあり<br>
ソフトな履き心地で足にしっくりとフィットします。<br><br>

男女問問わないシンプルデザインはプレゼントにも最適<br><br>

対応サイズ：約24.5cmの方まで（外寸約25.5cm）<BR>
カラー：アイボリー、レッド、ブラック<BR>
素　材：合成皮革<BR>
底　面：スエード調<BR>
ベトナム製<br><br>

<BR>



