かわいいヒヨコたちが並んだ子供スリッパ♪国産です。<BR>
軽くて　音がしなくて　洗えます！<BR>
16.5cmくらいまで対応のキッズサイズです。<BR><BR>

足にフィットするソフトスリッパ。<BR>
軽くてパタパタ音がしにくく、すべりにくいのが特徴です。<BR>
しっかりしているのに柔軟性があり、クッション材で衝撃を吸収してくれて、<BR>履き心地もGood！<BR>
甲にあたる部分には、パイル素材を使用していて気持ちいいです。<BR>
底面はスナメ素材。滑りにくくなっています。<BR><BR>
ウォッシャブルだから丸洗いもOK!<BR>
洗えるからいつも清潔なスリッパです♪<BR>
<BR>
【サイズ】<BR>
子供サイズ<BR>
・16.5cmまでの靴をお履きの方に対応（外寸約18cm）<BR>
<BR><BR>

底は黒のスナメ（発泡樹脂）<BR>
日本製<BR><BR>

<BR>

【スナメの説明】<BR>
<TABLE border="1" width="400" cellpadding="5" cellspacing="0"><TR><TD>

特徴１、【滑りにくい】表面はすべりにくく、細かい砂目のような感じになっています。硬い素材ではないので、床を傷つけるような心配はありません。<BR><BR>

特徴２、【柔軟性】　ソフトな素材なので、足裏に添って曲がり、足にフィットしてパタパタしません。足にくっついてくるので、脱げにくいです。<BR><BR>

特徴３、【磨り減りにくい】樹脂なので、布に滑り止め加工をした製品に比べて磨り減りにくいです。
また、キッチン床の水滴などを踏んでも、浸み込みにくいです。
</TD></TR></TABLE><BR>




